import React from 'react';
import ReactDOM from 'react-dom/client';
import styles from './styles.module.css';
import pic1 from './images/beach.jpg';
import pic2 from './images/mewalking.jpg';
import pic3 from './images/fronthall.jpg';
import pic4 from './images/night.JPG';

function About() {
    return(
        <home>
            <div className={styles.photoGridContainer}>
                <div className={styles.photoGrid}>
                    <img src={pic1} alt="bike" width="400"/>
                <div className={styles.bio}>
                    <strong><br/>About Matthew</strong>
                </div>
                    <br/>Matthew's Pet Services is the direct product of one man's love of dogs. <br/><br/> Since he was a young child, Matthew Tufts has always had a special love for dogs. Unfortunately, as a child Matthew never had the opportunity to take care of a dog of his own. Instead, he found ways to interact with dogs through friends, neighbors, and extended family. <br/><br/>  
                    <img src={pic3} alt="bike" width="400"/>
                    <br/> His life changed one day when his family welcomed a baby maltipoo into their home and into their hearts. <br/><br/>Upon learning what it takes to raise a dog, Matthew developed a sympathy for fellow dog owners. What has he done about it? That's where Matthew's Pet Services comes into the picture.<br/><br/>   
                    <img src={pic2} alt="bike" width="400"/>
                    <br/>Tufts' Bicycle hosts the annual Pedal for Peace ride, which has been nominated for multiple Nobel Peace Prizes. Through it all, Timmy's love for cycling has continued to flourish. With every bicycle sold, Tufts' Bicycle donates fifty percent of the profit to Timmy's Tots, a charity which introduces cycling to children in need. <br/><br/>Rolling forward, Tufts' Bicycle has goals to expand internationally, with sights of becoming the world's foremost source for all things bicycles.<br/><br/>Each bike sold guarantees a happy, healthy, and heartening time. <br/><br/>
                    <img src={pic4} alt="bike" width="400"/>
                </div>
            </div>
            <div className={styles.home}>
                ~<br/>"While some see two wheels and a handlebar, I see a lifetime of adventure and joy"<br/>~
            </div>  
            <div className={styles.footer}>
                Utilized with <em><a href="https://github.com/tuftsm/cp03.git" target="_blank">Github classroom</a></em>&emsp;&emsp;&emsp;
                All images licensed for use with <em>Creative Commons</em> licensing. The creator of this website does not claim to own any images.<br/>
            </div>   
        </home>
    );
};


export default About;
